import LoginPage from "../pages/LoginPage";
import NotesPage from "../pages/NotePages";
import { BrowserRouter,Routes, Route }   from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>

        <Route index element={<NotesPage />}/>
        <Route path="/login" element={<LoginPage/>}/>

      </Routes>      
      </BrowserRouter>


    </div>
  );
}

export default App;
